import {FormControl} from "@chakra-ui/react";
import InputField from "../InputField";

const Form = () => {
  return(
    <FormControl h="100vh" bg="#333" align="center" justify="center">
      <InputField label="Nome"/>
      <InputField label="E-mail"/>
      <InputField label="CPF" />
    </FormControl>
  );
}

export default Form;
